import React from "react";
import Navbar from "./Navbar";

const CustomerContact = () => {
  return (
    <div>
      <Navbar />
      <div class="container">
        <div class="card">
          <div class="card-body">This is some text within a card body.</div>
        </div>
      </div>
    </div>
  );
};

export default CustomerContact;
